const { default: Header } = require("../../components/header")
import Profile from './Components/ProfileBody';
import Head from '../../components/head';
import Footer from '../../components/footer';
const Index = ()=>{
    return(
        <div className="body">
            <Head/>
            <Header/>
            <Profile/>
            <Footer/>
        </div>
    )
}
export default Index ;
